"Unglaubliche 3.200 verschiedenen Sorten gibt es. Nur rot sind die aber nicht.
Es gibt weiße, gelbe, orange, rote, rosa, violette, grüne, braune, schwarze und auch gestreifte und marmorierte Tomaten.

Ursprünglich stammt die Tomate aus Mittel- und Südamerika. Nach Europa brachte sie Christoph Kolumbus 1498. Allerdings waren die Urtomaten, die in den Anden wuchsen nicht größer als Johannisbeeren.

Der Begriff Tomate leitet sich von Xitomatl ab, das aus der Nuahatl-Sprache stammt. Die Sprache wird unter anderem von den Azteken, den Ute und den Schoschonen gesprochen."

